import React from 'react';

const RpcGame = () => {
  return (
    <>
      <div>
        <button>가위</button>
        <button>바위</button>
        <button>보</button>
      </div>
      <div>
        <p>나의 선택</p>
        <p>에러메시지</p>
        <p>현재점수</p>
      </div>
    </>
  );
};

export default RpcGame;
